INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (6055, 718, 1177, '2018-04-20 00:00:00', '11:02', 'O decreto foi realizado analisando este tópico.\r\n\r\nA partir do momento que o Moderador Felipe Santos adiou a rodada, apenas os comentários em sequência foram válidos, como não houve comentários por parte do técnico Villarreal, foi dado WO em favor do técnico do Southampton.\r\n\r\nAo revisar este decreto, vi que o técnico rodrigofifa78 tentou realizar a marcação no tópico do jogo da VOLTA, no tópico em questão, houve um WO em favor do técnico do Villarreal.\r\n\r\nNo regulamento consta: Em jogos de MataxMata com sistema de ida e volta, o técnico que perder por WO no jogo de volta, seja por omissão parcial ou total, independentemente do resultado do jogo de ida, fica automaticamente desclassificado.\r\n\r\nConcluindo:\r\n\r\nHouve um erro de minha parte ao decretar a segunda partida deste confronto. Levei em consideração apenas o tópico do jogo de ida. Lamento o ocorrido e peço sinceras desculpas aos dois técnicos, principalmente rodrigofifa78. \r\n\r\nAbraço', 'HugoSiqueira94');
