INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5593, 905, 1206, '2018-04-14 00:00:00', '14:29', 'Fiquei esperando até agora e não recebi convite do jogo.\r\nMandei msg na psn dizendo q eu tava on e 10 min depois me respondeu que estava terminando uma. Esperei mas se passaram mais 15 min\r\nSou casado e tenho meus compromissos, irei viajar agora pra casa do meu sogro\r\nDeixo a critério da moderação ', 'Rick_simoes');
INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5594, 905, 484, '2018-04-14 00:00:00', '14:30', 'Você tá de savsacana? Eu te respondi e vc disse mais nada.\r\n\r\nIsso é coisa de criança. Seja homem e poste o print', 'leandrobranco19');
INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5595, 905, 484, '2018-04-14 00:00:00', '14:36', 'Adversário online e convite enviado sem resposta. \r\n\r\nPrints enviados a moderação. \r\n\r\n', 'leandrobranco19');
INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5596, 905, 484, '2018-04-14 00:00:00', '14:37', 'Você nunca irá ser um jogador de primeira divisão do site atuando de uma forma tão infantil. ', 'leandrobranco19');
