INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5598, 905, 1206, '2018-04-14 00:00:00', '14:44', 'Sim, respondeu. Tanto q permaneci online. Preciso mandar msg de aviso de leitura agora?\r\nCoisa de criança é deixar os outros esperando e esperei 29 min.\r\nTenho print sim. Peço mais respeito por favor\r\nAgora falar q eu estava online em conjunto com o convite enviado é uma tremenda mentira sua.\r\nMas como disse, deixo a critério da moderação.', 'Rick_simoes');
INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5599, 905, 484, '2018-04-14 00:00:00', '14:48', 'Já mandei os prints, atitude infantil de quem quer cavar w.o, sem necessidade, sem nem falar nada. Simplesmente disse que estava on, eu respondi e você veio já no tópico falando que te fiz esperar... Mete outra. Tu nem perguntou nada, saiu saindo.\r\n\r\nParabéns!\r\n\r\nE o jogo vai até o dia 16.\r\n\r\nJogo amanhã de 20 as 23\r\n\r\nFaço questão de jogar essa oaetidp.', 'leandrobranco19');
INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5600, 905, 484, '2018-04-14 00:00:00', '14:48', 'Essa partida*', 'leandrobranco19');
INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5601, 905, 1206, '2018-04-14 00:00:00', '15:03', 'Atitude muito adulta msm é deixar os outros esperando 29 min após do horário do jogo marcado. Não estou cavando wo, afinal esse campeonato nem tenho mais chances de classificação, não faz nenhum sentido essa acusação.\r\nE eu n fui correndo no tópico como vc falou não, esperei ainda mais 15 min. Se vc tem prints como diz é só olhar os horarios. Fiquei esperando prontamente no tempo que já disse. Muito além do tempo tolerado. Sabia q eu tava on e sabia do tempo então n me fala e eu sai do nada.\r\nPra quem fala pra eu estou tendo uma atitude infantil e sem hombridade, o senhor está se mostrando ter ataque de uma garotinha de 6 anos.', 'Rick_simoes');
INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5602, 905, 1206, '2018-04-14 00:00:00', '15:03', 'Agora sem mais. Deixo pra moderação ', 'Rick_simoes');
