INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (7702, 460, 1144, '2018-05-17 00:00:00', '14:44', 'Boa tarde amigo,\r\nMeus horarios sao\r\nSegunda a quinta das 09 as 10 das 13 30 as 15hrs e das 23 30 as 00hrs\r\nsexta das 13 30 as 15hrs\r\nsabado das 11 as 12 30\r\n\r\nDesculpa a demora, semana corridissima !', 'vbragaia');
INSERT INTO `TB_COMENTARIO_JOGO_18` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (7703, 1263, 944, '2018-05-17 00:00:00', '14:46', 'Opa... Depois das 23hrs fica ruim para mim. \r\nPodemos combinar no final de semana. O que acha?\r\nSábado pela manha e domingo pela manha tá tranquilo para mim. \r\nPor volta das 11 hrs.', 'M4GO__08');
